script: |
  super -f text -I q10903.spq | sort > q10903.out

inputs:
  - name: q10903.spq
    data: |
      SELECT 2, - ( - + col2 ) FROM tab0 (FORMAT parquet) WHERE 20 * - + col1 * + col2 / + 89 NOT IN ( + col0 * - col0, - col1, + - 36 ) AND NULL IS NOT NULL;
  - name: tab0

outputs:
  - name: q10903.out
    data: |
